L'application mobile Bison Futé fournit une information fiabilisée sur l'ensemble du réseau routier national (tous les événements et leurs conséquences proviennent des gestionnaires du réseau routier national) et en temps réel (données actualisées toutes les 3 à 6 minutes).

Vous trouverez en particulier :
- les prévisions de trafic sous la forme de jours colorés : vert, orange, rouge ou noir ;
- les prévisions détaillées précisant les axes les plus circulés, les horaires à éviter ainsi que des conseils pour vos déplacements ;
- une carte des événements routiers en temps réel (route fermée incident, panne, accident, bouchon, chantier, etc.) avec leur localisation, leur description, leurs impacts sur la circulation et, quand c’est possible, la durée prévisible des perturbations ;
- l'état du trafic dans 17 grandes agglomérations ;
- les conditions de conduite hivernales sur le réseau routier national pendant la période de viabilité hivernale (de mi-novembre à mi-mars) ;

L’application Bison Futé sur smartphone est disponible gratuitement.
Elle ne comporte aucun message publicitaire.

N'hésitez pas à nous faire part de vos idées d'évolutions de l'application, nous serons heureux de vous répondre et de les prendre en compte.

Pour améliorer l’information des usagers des autoroutes et routes nationales en Ile-de-France, l’État met en ligne une nouvelle version de l’application Sytadin pour smartphone, avec : 

► Une interface améliorée, une carte plus précise ;

► Mon Sytadin : un accès direct aux informations personnalisées sur vos itinéraires préférés ;

► SOS : une borne d’appel virtuelle pour contacter rapidement les services d’urgence selon sa géolocalisation.


Et toujours :

• Une information fiabilisée : tous les événements et leurs conséquences sont vérifiés par les spécialistes du trafic de la Direction des routes d'Ile-de-France, qui croisent les sources d’information ;

• Une information en temps réel, provenant directement des capteurs implantés sur le réseau routier, des équipes d’intervention, des caméras et des données fournies par les véhicules en circulation ;

• Une information prévisionnelle, avec notamment les fermetures de routes prévues sur les 7 nuits à venir ;

• Une information intégrée, avec le type d’événement (incident, panne, accident, chantier, etc.), sa localisation, son origine, sa description, ses impacts sur la circulation et, quand c’est possible, la durée prévisible des perturbations.


L’application SYTADIN sur smartphone, sans aucune publicité commerciale est disponible gratuitement.

La direction des routes d’Île-de-France (DiRIF) est le service public des autoroutes et routes nationales en Île-de-France. Elle a vocation à permettre et faciliter les déplacements régionaux, nationaux et internationaux sur le réseau routier national dans la région capitale. À ce titre elle est chargée de l’exploitation et du développement de Sytadin. Service déconcentré du ministère chargé des transports, la DiRIF est placée sous l’autorité du préfet d’Île-de-France, préfet de Paris, au sein de la direction régionale et interdépartementale de l’équipement et de l’aménagement (DRIEA) d’Île-de-France.

Miio app allows you to comfortably charge your electric vehicle in Portugal, France and Spain, get to know the final price beforehand and interact with the community. 

Miio makes it possible to:
- Charge your vehicle through the app or physical card;
- Have full control over your expenses, before, during and after your charging session;
- View the most complete charging station map, with power indicators, plug availability and type of venue;
- Get help to choose between charging stations and plugs, according to your vehicle specificities;
- Monitor your charging session from distance and in real time, with smart alarms; 
- Comment, rate and add photos to charging stations;
- Be notified about state and price changes, or about new stations; 
- Save your favorite or recent charging stations;
- Plan your trips: where to stop and charge, how long it will take and how much it will cost you;
- Earn bonus with our campaigns;
And much more!
